import React, { Component } from 'react';
import { PayrollEmployeeList } from './PayrollEmployeeList';
import { PayrollEmployee } from './PayrollEmployee';

export class Layout extends Component {
  static displayName = Layout.name;

    // eslint-disable-next-line no-useless-constructor
  constructor (props) {
    super(props);
    this.state = {
      showlist: true,
    };
  }

  render (employeeList) {
    return (
      <div className="Maindiv hidden">
        <PayrollEmployeeList style={this.state.showlist ? {} : { display: 'none' }}></PayrollEmployeeList>
        <PayrollEmployee style={this.state.showlist ? {} : { display: 'none' }}></PayrollEmployee>
      </div>
    );
  }
}
